sql='
DECLARE $l AS List<Tuple<STRING?>>;
SELECT `age`, `hash`, `id` FROM `dby` WHERE AsTuple(`hash`) IN $l    '
for i in 1 2 3 4 5; do
echo $(date +"%T.%6N") "LIST sta $i" >&2
echo "$data" | /ydb >&2 -p ${PROFILE} table query execute --stats=full -q "$sql"
echo $(date +"%T.%6N") "LIST fin $i" >&2
done
echo $(date +"%T.%6N") "LIST SCAN sta $i" >&2
echo "$data" | /ydb >&2 -p ${PROFILE} table query execute --stats=full -t scan -q "$sql"
echo $(date +"%T.%6N") "LIST SCAN fin $i" >&2
sql="`echo $sql|sed 's/dby/dbz/g'`"
data="`echo "$data"|sed 's/[0-9a-f][0-9a-f]/\\\u00&/g'`"
